        onClick={() => this.props.trackClick(this.props.id)}
      >
        <div className="frame">
          <img src={this.props.trackAlbumArtUrl} alt={this.props.trackTitle} />
        </div>

        <div className="meta">
          <div>
            <h2>{this.props.trackTitle}</h2>
            <h3>
              {this.props.trackArtist} â€¢ {this.props.trackAlbum}
            </h3>
          </div>
        </div>
      </div>
    );
  }
}

export default Track;
